R3-UWM-216-1170LIPP020-VR3-UWM-216-1170','LIPPY','nep','LIPP020-VR3-UWM-216-1170',50,-128,'2010-10-02T06:00:00Z','RECOVERD','N','Deployment/Recovery Notes: '),('LIPP021-VR3-UWM-221-1406','nepLIPPYLIPP021-VR3-UWM-221-1406LIPP021-VR3-UWM-221-1406','LIPPY','nep','LIPP021-VR3-UWM-221-1406',50,-128,'2012-05-23T22:35:00Z','RECOVERD','N','Deployment/Recovery Notes: Communication was initiated multiple times: 19:44, 20:06, 20:17. Multiple enable (6) and release (25) commands were sent. The units pings back once in a while, but never confirming its release state. We thought the battery was getting weak in the release, so we gave it some time between release cmd to bring the capacity back up. We pinged it multiple time before leaving the site to confirm that it was still at depth. Arrived on station at 18:19. Initiated comms at 18:23, 18:46. We tried to enable it 15 times using the UDB9000, but were unsuccessful. Data was downloaded at 19:29 (tilt was 2degrees and battery was 7.1volts. We made one last attempt to communicate with the release using the UDB7000. It worked immediatly and we were able to recover the unit at 19:45. '),('LIPP022-VR3-UWM-65-1958','nepLIPPYLIPP022-VR3-UWM-65-1958LIPP022-VR3-UWM-65-1958','LIPPY','nep','LIPP022-VR3-UWM-65-1958',50,-128,'2012-05-24T03:10:00Z','RECOVERD','N','Deployment/Recovery Notes: Station 5 was enabled and the release command sent but the pod did not surface.  It was difficult to tell whether we were hearing a four ping reply. Sounded like extended noise/echo, but may have been four closely spaced pings. These borrowed releases exhibit more closely spaced ping reply than OTN units. The release definitely woke up and the range made sense. If it was four pings than it would be a confirmed release but pod did not surface.  Release command was sent many times. Initiated comms at 11:00 using UDB9000 from Zodiac to help locate it. The ROV located it at 13:40 and brought it up to the surface at 15:30. The release was opened, but the lever was stuck. Once on deck, it was found that the release lever was quite stiff. A build up of salt or possibly zinc residue was found to have coated the lever pin and lever pin-shaft, preventing a smooth action. Acoustic release and acoustic receiver seemed fine.'),('LIPP023-VR3-UWM-112-807','nepLIPPYLIPP023-VR3-UWM-112-807LIPP023-VR3-UWM-112-807','LIPPY','nep','LIPP023-VR3-UWM-112-807',50,-128,'2010-10-01T19:50:00Z','RECOVERD','N','Deployment/Recovery Notes: '),('LIPP023-VR3-UWM-66-1959','nepLIPPYLIPP023-VR3-UWM-66-1959LIPP023-VR3-UWM-66-1959','LIPPY','nep','LIPP023-VR3-UWM-66-1959',50,-128,'2012-05-24T23:50:00Z','RECOVERD','N','Deployment/Recovery Notes: Caught by redfisher well west of line, was offloaded 2015_09_16'),('LIPP024-VR3-UWM-113-808','nepLIPPYLIPP024-VR3-UWM-113-808LIPP024-VR3-UWM-113-808','LIPPY','nep','LIPP024-VR3-UWM-113-808',50,-128,'2010-10-01T18:20:00Z','RECOVERD','N','Deployment/Recovery Notes: '),('LIPP024-VR3-UWM-68-1960','nepLIPPYLIPP024-VR3-UWM-68-1960LIPP024-VR3-UWM-68-1960','LIPPY','nep','LIPP024-VR3-UWM-68-1960',50,-128,'2012-05-24T00:15:00Z','RECOVERD','N','Deployment/Recovery Notes: Initiated comms at 14:54. 5 enable and 3 release cmds were necessary to confirm its released state. The mooring did not surface. Seems stuck at 80-90m, close to the navigation buoy. We were able to download data after multiple attemps (18) while positionned SW from its original position. Tilt was 80 degrees, battery voltage was 7.1V.  We were not successful at enabling it from HFX017 (17:19). We were able to enable it at HFX021; slant range was close to water depth when sitting right above. It still still stuck and will not surface.  Used the ROV to recover. Release was missing; it was ripped off the strongback; floats we exploded. VR3 looked fine but was not downloaded until later. '),('LMN-001-VR2W-109467-1','OTN-GlobalSMRSLLMN-001-VR2W-109467-1LMN-001-VR2W-109467-1','SMRSL','OTN-Global','LMN-001-VR2W-109467-1',46,-84,'2010-08-02T19:50:00Z','RECOVERD','N','D